import React from 'react';
import Organism from './Organism';
import { string } from 'prop-types';

type OrganismListProps = {
    organisms: Array<string>,
    selectedOrganism: string | null,
}

class OrganismList extends React.Component<any, OrganismListProps> {
    constructor(props: OrganismListProps) {
        super(props);
        this.state = {
            organisms: [],
            selectedOrganism: null,
        }
    }
    render() {
        return (
            <div>
                {
                this.props.organisms.map((organism:string, index:number) => (
                    <Organism key={index} organismName={organism} isSelected={false} />
                ))
                }

            </div>
        )
    }
}

export default OrganismList;
